Here is the JSON array to perform various clerical or administrative functions, such as ordering and maintaining an inventory of supplies:

<OUTPUT_JSON>
[
  {
    "action": "click",
    "selector": "input[placeholder*=search i]",
    "text": "paper"
  },
  {
    "action": "click", 
    "selector": "button:has-text(\"add item\" i)",
    "text": ""
  },
  {
    "action": "fill",
    "selector": "input[name*=quantity i]", 
    "text": "10"
  },
  {
    "action": "click",
    "selector": "button:has-text(\"order\" i), button:has-text(\"submit\" i)",
    "text": ""
  }
]
</OUTPUT_JSON>
